//VERSION=3
let minVal = 0.0;
let maxVal = 0.4;

let viz = new HighlightCompressVisualizer(minVal, maxVal, 1.2, 0, 1.2);

function setup() {
    return {
        input: ["red", "green", "blue", "dataMask"],
        output: {
            bands: 4
        }
    };
}
const factor = 1 / 2000;

function evaluatePixel(sample) {
    const val = [factor * sample.red, factor * sample.green, factor * sample.blue, sample.dataMask];
    return viz.processList(val);
}
